import pandas as pd

data_path = '/content/drive/My Drive/StudyingKeras/RNN/jena_climate_data_2009_20016/jena_climate_2009_2016.csv'

# Этот код выведет 420 551 строку с данными - каждая строка соответствует
# одному замеру и содержит дату замера и 14 значений разных параметров
data = pd.read_csv(data_path)
data

"""Теперь преобразуем все 420 551 строку с данными в массив Numpy."""

import numpy as np

with open(data_path, 'r') as f:
  data = f.read()

# получение всех строк 
lines = data.split('\n')
# получение заголовков всех столбцов
header = lines[0].split(',')
lines = lines[1:]

float_data = np.zeros((len(lines), len(header) - 1))
for i, line in enumerate(lines):
  # каждое значение в строке отделено запятой
  values = [float(x) for x in line.split(',')[1:]]
  # все переведенные в float числа помещает в массив
  float_data[i, :] = values

"""По полученным данным построим график изменения температуры за 8 лет"""

import matplotlib.pyplot as plt

# температура в градусах Цельсия
temp = float_data[:, 1]
plt.plot(range(len(temp)), temp)

"""По полученным данным построим график изменения температуры за 10 дней"""

# данные фиксировались каждые 10 минут - значит за сутки 144 замера, 
# а за 10 дней - 1440
plt.plot(range(1440), temp[:1440])

# видно, что изменение температуры в течении нескольких дней выглядит более хаотично
# чем в течении нескольких лет или месяцев

"""# Формулировка задачи
по lookback интервалам (один интервал равен 10 минутам) за прошлый период, из которых отобраны образцы через каждые step интервалов, предсказать температуру на следующие delay интервалов

Нормализация данных

(используем для обучения только первые 200_000 образцов)
"""

# все данные измеряются в разных диапозонах (температура, давление...)
# поэтому нормализуем их
mean = float_data[:200_000].mean(axis=0)
float_data -= mean
std = float_data[:200_000].std(axis=0)
float_data /= std

"""Создание функции-генератора"""

# принимает: текущий массив данных
# возвращает: пакеты, представляющие собой недавнее прошлое, предсказанную температуру
# data - нормализованные данные
# lookback - количество интервалов из прошлого
# delay - количество интервалов из будущего
# min_index, max_index - границы в data, в которых выбираются значения
# shuffle - извлекать по порядку или с перемешиванием
# batch_size - количество образцов в пакете
# step - период в интервалах, в котором выбираются значения (6 - значит каждый час)

def generator(data, lookback, delay, min_index, max_index, 
              shuffle=False, batch_size=128, step=6):
  # если правая граница не указана - она определяется сама
  if max_index is None:
    max_index = len(data) - delay - 1
  # правая граница первого интервала
  i = min_index + lookback
  while True:
    if shuffle:
      # если данные не извлекаются по порядку, то генерируем список случайных
      # строк, откуда эти данные будем брать
      rows = np.random.randint(min_index + lookback, max_index, size=batch_size)
    else:
      if i + batch_size > max_index:
        # если дошли до конца (до самой правой границы), то возвращаемся в начало
        i = min_index + lookback
      # генерируем список подряд идущиъ индексов строк
      rows = np.arange(i, min(i + batch_size, max_index))
      # смещаем правую границу первого интервала к концу только что созданного списка
      # так как мы его будем обрабатывать и больше его начало нас не интересует
      i += len(rows)
    # создаем тензоры образцов и целей
    # все это - просто часть известных данных из файла
    # samples - данные из прошлого
    # targets - данные (как бы) из будущего (просто правее)
    samples = np.zeros((len(rows), lookback // step, data.shape[-1]))
    targets = np.zeros((len(rows),))
    for j, row in enumerate(rows):
      # берем lookback значений из прошлого с интервалом step
      indices = range(rows[j] - lookback, rows[j], step)
      # извлекаем образцы из прошлого по индексам
      samples[j] = data[indices]
      # извлекаем цели (которые тоже образцы) из будущего
      targets[j] = data[rows[j] + delay][1]
    # образцы возвращаются в прямом порядке
    # для большинства временных последовательностей если сеть обрабатывает последовательность в прямом порядке
    # то она лучше обучается, чем если в обратном
    yield samples, targets

"""Создание генераторов тренировочных, проверочных и тестовых образцов"""

# 10 дней назад
lookback = 1440
# замеры раз в час
step = 6
# вперед на день
delay = 144
batch_size = 128

train_generator = generator(
    float_data, 
    lookback=lookback,
    delay=delay,
    min_index=0,
    max_index=200_000,
    shuffle=True,
    step=step,
    batch_size=batch_size
)

val_generator = generator(
    float_data, 
    lookback=lookback,
    delay=delay,
    min_index=200_001,
    max_index=300_000,
    shuffle=True,
    step=step,
    batch_size=batch_size
)

test_generator = generator(
    float_data, 
    lookback=lookback,
    delay=delay,
    min_index=300_000,
    max_index=None,
    shuffle=True,
    step=step,
    batch_size=batch_size
)

# сколько раз надо обратиться к val_generator, чтобы получить проверочный набор целиком
val_steps = (300_000 - 200_001 - lookback) // batch_size
# сколько раз надо обратиться к test_generator, чтобы получить тестовый набор целиком
test_steps = (len(float_data) - 300_001 - lookback) // batch_size

"""# Базовое решение без машинного обучения

Стоит провести некоторую "базовую линию", которая будет точкой отсчета, и которую надо будет превзойти с помощь. машинного обучения.

Все последовательности, представленные в наборе данных - монотонные. То есть температура завтра будет совсем немного отличаться от сегодняшней. Поэтому используем метрику средней абсолютной ошибки.
"""

# вычисляется средняя ошибка предсказания
def evaluate_naive_method():
  batch_maes = []
  for step in range(val_steps):
    # получение пакетов образцов и целей
    samples, targets = next(val_generator)
    # получение предсказаний из образцов
    preds = samples[:, -1, 1]
    # вычисляется разность между предсказаниями и целями и берется среднее
    mae = np.mean(np.abs(preds - targets))
    batch_maes.append(mae)
  return np.mean(batch_maes)

mae = evaluate_naive_method()

# так как данные были нормализованы (от 0 до 1), то для наглядности перемедем полученный результат в градусы Цельсия
print(f'The mean average error is {mae * std[1]} degrees Celsius')

"""# Базовое решение с машинным обучением

Перед созданием сложной и затратной в вычислительном плане рекуррентной нейронной сети, есть смысл создать простую полносвязную сеть, чтобы убедиться, что она не достаточно хороша
"""

from keras.models import Sequential
from keras.layers import Dense, Flatten

simple_model = Sequential()
# УМЕНЬШЕНИЕ РАЗМЕРНОСТИ СТИРАЕТ ПОНЯТИЕ "ВРЕМЕННОЙ ПОСЛЕДОВАТЕЛЬНОСТИ"!
simple_model.add(Flatten(input_shape=(lookback // step, float_data.shape[-1])))
simple_model.add(Dense(32, activation='relu'))
simple_model.add(Dense(1))

simple_model.compile(optimizer='rmsprop', loss='mae')
history = simple_model.fit(
    # когда тренируем с генератором, всегда надо указывать количество шагов в эпоху,
    # потому что он не понимает, когда эпоха заканчивается
    train_generator,
    steps_per_epoch = 500,
    epochs = 20,
    validation_data = val_generator,
    validation_steps = val_steps
).history

"""Создание графика тренировки"""

def draw_graph(history):
  import matplotlib.pyplot as plt
  loss = history['loss']
  val_loss = history['val_loss']
  epochs = range(1, len(loss) + 1)
  plt.figure()
  plt.plot(epochs, loss, 'bo', label='Training loss')
  plt.plot(epochs, val_loss, 'b', label='Validation loss')
  plt.title('Training and validation loss')
  plt.legend()
  plt.show()

draw_graph(history)

"""Оценка ошибки на тестовых данных"""

mae = simple_model.evaluate(test_generator, steps=500, verbose=1)

# по какой-то причине ошибка только возрасла по сравнению с базовым решением
print(f'The mean average error is {mae * std[1]} degrees Celsius')

"""# Обучение и оценка модели на основе GRU

Сети GRU (Gate Recurrent Unit) подходят для более простых задач, чем LSTM
Они не могут хранить состояние так долго, как LSTM
Работают быстрее, чуть менее точно

![image.png](data:image/png;base64,)
"""

from keras.models import Sequential
from keras.layers import Dense, GRU

gru_model = Sequential()
# размерность входных данных - (количество образцов, количество столбцов в csv)
gru_model.add(GRU(32, input_shape=(None, float_data.shape[-1])))
gru_model.add(Dense(1))

gru_model.compile(optimizer='rmsprop', loss='mae')
gru_history = gru_model.fit(
    train_generator,
    steps_per_epoch=500,
    epochs=20,
    validation_data = val_generator,
    validation_steps = val_steps
).history

"""Создание графика тренировки"""

draw_graph(gru_history)

"""Оценка ошибки на тестовых данных"""

mae = gru_model.evaluate(test_generator, steps=500, verbose=1)

# по какой-то причине ошибка только возрасла по сравнению с базовым решением без нейронной сети
print(f'The mean average error is {mae * std[1]} degrees Celsius')

"""# Обучение и оценка модели на основе GRU с прореживанием

Для того, чтобы прореживание (Dropout) не мешало, а помогало рекуррентному обучению, необходимо прореживать все пакеты данных с помощью ОДНОЙ маски. Кроме того, прореживание можно применять не только ко входным данным слоя, но и к внутренней рекуррентной функии активации слоя
"""

# каждый рекуррентный слой в keras имеет два аргумента для прореживания:
# 1) dropout - прореживает входные значения слоя
# 2) recurrent_dropout - прореживает рекуррентную функцию

from keras.models import Sequential
from keras.layers import Dense, GRU

gru_model = Sequential()
# размерность входных данных - (количество образцов, количество столбцов в csv)
gru_model.add(GRU(
    32,
    dropout=0.2,
    # если поставить recurrent_dropout не ноль, то cuDNN не будет работать и тренировка займет час 
    recurrent_dropout=0,
    input_shape=(None, float_data.shape[-1])))
gru_model.add(Dense(1))

gru_model.compile(optimizer='rmsprop', loss='mae')
gru_history = gru_model.fit(
    train_generator,
    steps_per_epoch=500,
    epochs=40,
    validation_data = val_generator,
    validation_steps = val_steps
).history

"""Создание графика тренировки"""

draw_graph(gru_history)

"""Оценка ошибки на тестовых данных"""

mae = gru_model.evaluate(test_generator, steps=500, verbose=1)

# по какой-то причине ошибка только возрасла по сравнению с базовым решением без нейронной сети
print(f'The mean average error is {mae * std[1]} degrees Celsius')
